(96, 'product', 79, 'ru', 'Aquatron', 'The durable Aquatron is one of the latest additions to the STORM BLACK range. This watch has all the premium qualities of STORM BLACK, with features such as date, swiss movement, sapphire glass and a rotating bezel. In addition to this it has a titanium case and extra strong Kevlar strap. This top of the range watch is uber stylish and water resistant up to an impressive 1,000m. Available in black and titanium.', '<table>\r\n\r\n<tr>\r\n<td>Features</td>\r\n<td>Titanium Case, Date, Swiss Movt, Rotating Bezel, Kevlar Strap</td>\r\n</tr>\r\n\r\n<tr>\r\n<td>Battery</td>\r\n<td>Standard Type</td>\r\n</tr>\r\n\r\n<tr>\r\n<td>Case Material</td>\r\n<td>Titanium</td>\r\n</tr>\r\n\r\n<tr>\r\n<td>Case Width</td>\r\n<td> W : 45mm X L : 55mm</td>\r\n</tr>\r\n\r\n<tr>\r\n<td>Case Height</td>\r\n<td> 14.5mm</td>\r\n</tr>\r\n\r\n<tr>\r\n<td>Water Resistance</td>\r\n<td>1000m</td>\r\n</tr>\r\n\r\n<tr>\r\n<td>Lens Material</td>\r\n<td>Sapphire Glass</td>\r\n</tr>\r\n\r\n<tr>\r\n<td>Caseback</td>\r\n<td>Stainless Steel</td>\r\n</tr>\r\n\r\n<tr>\r\n<td>Crown</td>\r\n<td>Other</td>\r\n</tr>\r\n\r\n<tr>\r\n<td>Band Type</td>\r\n<td>Kevlar</td>\r\n</tr>\r\n\r\n<tr>\r\n<td>Fitting Length</td>\r\n<td>210mm</td>\r\n</tr>\r\n\r\n<tr>\r\n<td>weight</td>\r\n<td>118g</td>\r\n</tr>\r\n\r\n</table>\r\n\r\n', 'Storm Aquatron', '', '', NULL, '2011-10-11 12:57:12'),
(97, 'product', 80, 'ru', 'Milli Curvex', 'The Milli Curvex watch comes with a brushed stainless steel strap and case with a variety of dial colours. Including blue, silver, violet, ice (an iridescent white) and ice blue (a light blue iridescent). This watch is also water resistant to 50m.', '<table>\r\n  <tr>\r\n    <td>Movement</td>\r\n    <td>Japanese Movement</td>\r\n  </tr>\r\n  <tr>\r\n    <td>Battery</td>\r\n    <td>Standard Type</td>\r\n  </tr>\r\n  <tr>\r\n    <td>Case Material</td>\r\n    <td>Stainless Steel</td>\r\n  </tr>\r\n  <tr>\r\n    <td>Case Finish</td>\r\n    <td>Polish</td>\r\n  </tr>\r\n  <tr>\r\n    <td>Case Diameter</td>\r\n    <td>20mm x 20mm</td>\r\n  </tr>\r\n  <tr>\r\n    <td>Lugs</td>\r\n    <td></td>\r\n  </tr>\r\n  <tr>\r\n    <td>W/R ATM</td>\r\n    <td>50m</td>\r\n  </tr>\r\n  <tr>\r\n    <td>Lens</td>\r\n    <td>Mineral Glass</td>\r\n  </tr>\r\n  <tr>\r\n    <td>Caseback</td>\r\n    <td>Stainless Steel</td>\r\n  </tr>\r\n  <tr>\r\n    <td>Crown</td>\r\n    <td>Stainless Steel</td>\r\n  </tr>\r\n  <tr>\r\n    <td>Band Type</td>\r\n    <td>Stainless Steel</td>\r\n  </tr>\r\n  <tr>\r\n    <td>Max Fitting Length</td>\r\n    <td>160mm Adjustable</td>\r\n  </tr>\r\n  <tr>\r\n    <td>Clasp Type</td>\r\n    <td>Stainless Steel  Jewellery Buckle</td>\r\n  </tr>\r\n  <tr>\r\n    <td>Total Weight</td>\r\n    <td></td>\r\n  </tr>\r\n</table>', 'Milli Curvex Womens Watch  Stainless Steel Women''s Watches', 'Storms Milli Curvex womens watch is simple yet stylish. It is made from highly durable, polished stainless steel and is water resistant up to 50 metres. It is available in blue, ice, silver and ice blue.', 'Milli Curvex womens watch, Storm watches, polished stainless steel watches, stainless steel watches, water resistant watches, womens watches', NULL, '2011-10-11 13:26:28'),
(98, 'product', 81, 'ru', 'New Asteroid', 'A classic STORM watch the New Asteroid comes with a polished stainless steel strap and case. This watch also features easilink strap for simple strap adjustment and is available in silver, blue, violet or ice blue (a light iridescent blue) dial colours.', '<table>\r\n  <tr>\r\n    <td>Movement</td>\r\n    <td>Japanese Movement</td>\r\n  </tr>\r\n  <tr>\r\n    <td>Battery</td>\r\n    <td>Standard Type</td>\r\n  </tr>\r\n  <tr>\r\n    <td>Case Material</td>\r\n    <td>Stainless Steel</td>\r\n  </tr>\r\n  <tr>\r\n    <td>Case Finish</td>\r\n    <td>Polish</td>\r\n  </tr>\r\n  <tr>\r\n    <td>Case Diameter</td>\r\n    <td>14.5mm x 39.5mm</td>\r\n  </tr>\r\n  <tr>\r\n    <td>Lugs</td>\r\n    <td>8mm</td>\r\n  </tr>\r\n  <tr>\r\n    <td>W/R ATM</td>\r\n    <td>N/A</td>\r\n  </tr>\r\n  <tr>\r\n    <td>Lens</td>\r\n    <td>Mineral Glass</td>\r\n  </tr>\r\n  <tr>\r\n    <td>Caseback</td>\r\n    <td>Stainless Steel</td>\r\n  </tr>\r\n  <tr>\r\n    <td>Crown</td>\r\n    <td>Stainless Steel</td>\r\n  </tr>\r\n  <tr>\r\n    <td>Band Type</td>\r\n    <td>Stainless Steel</td>\r\n  </tr>\r\n  <tr>\r\n    <td>Total Length</td>\r\n    <td>170mm</td>\r\n  </tr>\r\n  <tr>\r\n    <td>Max Fitting Length</td>\r\n    <td>170mm Easilink Adjustable</td>\r\n  </tr>\r\n  <tr>\r\n    <td>Clasp Type</td>\r\n    <td>Stainless Steel  Jewellery Buckle</td>\r\n  </tr>\r\n  <tr>\r\n    <td>Total Weight</td>\r\n    <td></td>\r\n  </tr>\r\n</table>', 'New Asteroid Womens Watch  Womens Watches', 'The New Asteroid womens watch from Storm is contemporary and sleek. The case and strap are made from the highest quality stainless steel and the strap is adjustable. It comes in silver, blue, violet and ice blue.', 'New Asteroid womens watch, Storm watches, stainless steel watches, adjustable strap watches, womens watches, STORM London', NULL, '2011-10-11 13:34:09'),
